Given the following

    declare module m {
        module s {}
        export import string = s;
    }

we would previously give the error

    Import name cannot be 'string'

when `string` is clearly not in conflict with any declared values.

Prior to this change, the following

    class Foo {
        var
        x = 1
    }

would be parsed as

    class Foo {
        var x = 1
    }

which meant that we would receive an error on the `var` token:

    Unexpected token. A constructor, method, accessor, or property was expected.

However, due to ASI rules, we should really consider `var` and `x` to be two distinct instance members.

this fixes several issues
* emitting name is illegal if if name is a javascript keyword (#43)
* property function name should not be in scope inside the function body:
Consider this code
```typescript
var x = 1
var y = { x() { x++; } }; 
```
Here `x` in `x++` should refer to the `var x`.
Traceur emits it as
```javacript
  var x = 1;
  var y = {x: function() {
      x++;
    }};
```

Handle the following:

    a => 
        var v = 0;
    }

as

    a => {
        var v = 0;
    }

while still reporting an error for a missing `{`,

eg:
```TypeScript
// @Filename: w1.ts
export = Widget1
class Widget1 { name = 'one'; }

// @Filename: exporter.ts
export import w = require('./w1');

// @Filename: consumer.ts
import e = require('./exporter');

export function w(): e.w { // Should be OK
    return new e.w();
}
```

In this looking for the name of return type of function w,
not just look for the alias == SymbolOfReturnType but also
look for alias.exportedSymbols === symbolOfReturnType
and qualify it during the toString

Fixes #523.

With this change the following declarations all create recursive types:
```typescript
var a: { x: typeof a; };
var b: () => typeof b;
var c: { (): typeof c; };
var d: { [s: string]: typeof d; };
```

Fixes #445 and #583.

Function expression bodies are now checked in a separate phase after all statements in the enclosing body to ensure constructs like the following are correctly typed:
```typescript
var foo = function () {
    var s = foo();
    return "hello";
}
```
Previously we'd perform a full type check of the body of the function expression whilst in the process determining the type of `foo` which would cause `foo` to be given type `any` because of the recursive reference. With this change, `foo` is now correctly typed as `() => string`.

In this example we are reporting the error as we widen. changing the behavior to not report errors as we widen in cast expressions, and additional optimization to only widen if we need to.

